  justify-content: space-between;
  align-items: center;
  margin-top: 160px;
  border-radius: 32px;
  background: rgba(255, 255, 255, 0.8);
  &__img {
    margin: 16px 16px 16px 0
  }
}

.ready-to-start {
  margin-left: 64px;
  &__text {
    margin: 16px 0 32px;
  }

  &__button{
    width: 256px;
    height: 56;
  }
}

.clients-review {
  margin-top: 160px;
}

.clients-review-header {
  text-align: center;
  &__text{
    margin-top: 24px;
  }
}

.reviews {
  display: grid;
  margin-top: 80px;
  grid-template-areas: 
    'case-studies case-studies stephen-skeel stephen-skeel stephen-skeel'
    'case-studies case-studies ivan-talaychuk ivan-talaychuk podcast'
    'pedro-morgado pedro-morgado ivan-talaychuk ivan-talaychuk g2'
    'matt-gallagher matt-gallagher matt-gallagher lion-energy lion-energy'
    'library ekaterina-sushchevskaya ekaterina-sushchevskaya lion-energy lion-energy'
    'clutch ekaterina-sushchevskaya ekaterina-sushchevskaya alan-morte alan-morte';
  gap: 32px;
}

.some-case-studies { grid-area: case-studies; }

.stephen-skeel { grid-area: stephen-skeel; }

.pedro-morgado { grid-area: pedro-morgado; }

.alan-morte { grid-area: alan-morte; }

.ivan-talaychuk { grid-area: ivan-talaychuk; }

.lion-energy { grid-area: lion-energy; }

.ekaterina-sushchevskaya { grid-area: ekaterina-sushchevskaya }

.g2-revieew { grid-area: g2; }

.clutch-review { grid-area: clutch; }

.how-to-library { grid-area: library; }

.matt-gallagher { grid-area: matt-gallagher; }

.growth-podcast { grid-area: podcast; }

.case-studies {
  padding: 32px;
  background: rgba(255, 255, 255, 0.8);
  backdrop-filter: blur(10px);
  border-radius: 16px;
  &__text {
    width: 464px;
    height: 178px;
  }
}

.case-studies-block {
  width: 178px;
  height: 82px;
  padding: 18px 20px 24px;
  margin: 32px 0 24px;
  border: 1px solid #FCE0D0;
  border-radius: 10px;
}

.tag {
  width: 76px;
  height: 16px;
  padding: 10px 16px;
  background: #292929;
  border-radius: 56px;
}

.testimonials {
  z-index: -2;
  padding: 32px;
  background: #292929;
  border-radius: 16px;
  overflow: hidden;
  &__bubble {
    position: relative;
    z-index: -1;
    width: 300px;
    height: 300px;
    bottom: 600px;
    right: 100px
  }
}

.quantity {
  background: rgba(255, 255, 255, 0.8);
  backdrop-filter: blur(10px);
  border-radius: 16px;
  padding: 32px;
  &__tittle {
    margin: 32px 0;
  }

  &__link {
    display: flex;
    vertical-align: middle;
    margin-top: 24px;
    &:hover{
    color: $orange;
    }
  }

  &__arrow {
    width: 16px;
    height: 16px;
    margin-left: 8px;
  }
}

.quantity-small {
  &__img {
    margin-right: 47px;
  }
}

.quantity-big {
  &__img {
    margin-left: 185px;
   }
}

.partner-review {
  border-radius: 16px;
  padding: 32px;
  &__tittle {
    display: flex;
    margin: 16px 0 4px;
  }
  &__text {
    margin-left: 8px;
  }
  &__logo {
    position: relative;
    left: 60px;
    top: 25px;
  }
  &__g2 {
    background: $orange;
  }
  &__clutch {
    background: #17313B;
  }
}

.faq {
  margin-top: 160px;
  &__tittle{
    margin: 0 0 64px;
  }
  &__bubble{
    &--orange{
      width: 128px;
      height: 128px;
      right: 208px;
      top: 158px;
    }
    &--white{
      width: 256px;
      height: 256px;
      right: 16px;
      top: 64px;
    }
  }
}

.question {
  display: flex;
  margin-top: 24px;
  max-width: 579px;
  padding: 16px 32px 16px 24px;
  border-radius: 32px;
  background: $white;
  &__image{
    margin-right: 12px;
  }
}

.seo-block {
  display: flex;
  justify-content: space-between;
  align-items:center;
  margin-top: 160px;
  padding: 40px;
  &__text {
    margin-top: 8px;
  }

  &__bubble {
    &--white {
      width: 192px;
      height: 192px;
      left: calc(50% - 192px/2 + 320px);
      top: calc(50% - 192px/2 + 96px);
    }
    &--orange {
      width: 64px;
      height: 64px;
      left: calc(50% - 64px/2 + 136px);
      top: calc(50% - 64px/2 - 92px);
    }
  }
}

.cta-form {
  margin-top: 160px;
  padding: 160px 0;
  background:$main-dark;
  overflow: hidden;
  &__bubble {
    &--big-gray {
      width: 460px;
      height: 460px;
      left: 1010px;
      bottom: -365px;
    }

    &--small-gray {
      width: 160px;
      height: 160px;
      left: calc(50% - 160px/2);
      top: -225px;
    }

    &--big-orange{
      width: 128px;
      height: 128px;
      right: -90px;
      top: 128px;
    }

    &--small-orange{
      width: 80px;
      height: 80px;
      left: 950px;
      bottom: 55px;
    }
  }
}

.cta-content {
  display:flex;
  justify-content: space-between;
  margin-bottom: 64px;
}

.cta-info {
  &__button{
    width: 214px;
    margin-top: 20px;
  }

  &__text{
    margin: 20px 0 40px;
  }
}

.cta-statistic {
  width: 560px;
  padding-left: 32px;
  &__item{
    display: flex;
    align-items: center;
    margin-top: 24px;
    max-height: 64px;
  }

  &__dot{
    margin: 0 32px;
    width: 8px;
    height: 8px;
    border-radius: 50%;
    background: $typography-dark-gray;
  }

  &__value{
    width: 140px;
  }

  &__tittle{
    margin-bottom: 8px;
  }
}

.awards {
  &__icons{
    margin-top: 32px;
  }
}

.footer {
  padding: 56px 48px 40px;
}

.footer-top {
  display: flex;
  justify-content: space-between;
  margin-bottom: 64px;
}

.footer-contacts {
  margin: 62px 0;
}

.footer-navigation{
  display: flex;
  justify-content: space-between;
}

.navigation-block {
  display: flex;
  flex-direction: column;
  margin-left: 75px;
  max-height: 50px;
  min-width: 108px;
  &__text {
    margin-bottom: 8px;
  }
}

.bottom {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.policy {
  margin-left: 203px;
  &__link {
    margin-left: 35px;
  }
  &__link:hover{
    color: $typography-gray;
  }
}
